  {
   "cell_type": "code",
   "execution_count": 5,
   "metadata": {},
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Training image datset size :  48905\n",
      "Test image dataset size :  16421\n"
     ]
    }
   ],
   "source": [
    "#function to load dataset\n",
    "def load_mydata(folder_path):\n",
    "    dataset = load_files(folder_path)\n",
    "    output_labels = np.array(dataset['target_names'])\n",
    "    file_names = np.array(dataset['filenames'])\n",
    "    output_class = np.array(dataset['target'])\n",
    "    return file_names,output_class,output_labels\n",
    "    \n",
    "\n",
    "# Loading training and test dataset\n",
    "x_training, y_training, output_labels = load_mydata(training_folder)\n",
    "x_test, y_test,_ = load_mydata(test_folder)\n",
    "#Loading finished\n",
    "\n",
    "print('Training image datset size : ' , x_training.shape[0])\n",
    "print('Test image dataset size : ', x_test.shape[0])"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 6,
   "metadata": {},
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Number of ouput classes :  95\n"
     ]
    }
   ],
   "source": [
    "count_output_classes = len(np.unique(y_training))\n",
    "print(\"Number of ouput classes : \",count_output_classes)"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 7,
   "metadata": {},
   "outputs": [
    {
     "name": "stderr",
     "output_type": "stream",
     "text": [
      "Using TensorFlow backend.\n"
     ]
    }
   ],
   "source": [
    "#output classes are converted to one-hot vector\n",
    "from keras.utils import np_utils\n",
    "y_training = np_utils.to_categorical(y_training,count_output_classes)\n",
    "y_test = np_utils.to_categorical(y_test,count_output_classes)"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 8,
   "metadata": {},
   "outputs": [
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "Vaildation set size :  (8000,)\n",
      "Test set size :  (8421,)\n"
     ]
    }
   ],
   "source": [
    "#testset splitted into validation and test dataset \n",
    "x_test,x_validation = x_test[8000:],x_test[:8000]\n",
    "y_test,y_vaildation = y_test[8000:],y_test[:8000]\n",
    "print('Vaildation set size : ',x_validation.shape)\n",
    "print('Test set size : ',x_test.shape)"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 9,
   "metadata": {},
   "outputs": [],
   "source": [
    "#all the images are converted to arrays\n",
    "from keras.preprocessing.image import load_img,img_to_array\n",
    "\n",
    "def image_to_array_conversion(filenames):\n",
    "    img_array=[]\n",
    "    for f in filenames:\n",
    "        # Image to array conversion\n",
    "        img_array.append(img_to_array(load_img(f)))\n",
    "    return img_array\n",
    "\n",
    "\n",
    "x_training = np.array(image_to_array_conversion(x_training))\n",
    "x_validation = np.array(image_to_array_conversion(x_validation))\n",
    "x_test = np.array(image_to_array_conversion(x_test))"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": null,
   "metadata": {},
   "outputs": [],
   "source": [
    "#normalization training,validation and testset\n",
    "x_training = x_training.astype('float32')/255\n",
    "x_validation = x_validation.astype('float32')/255\n",
    "x_test = x_test.astype('float32')/255"
   ]
  },
  {
   "cell_type": "markdown",
   "metadata": {},
   "source": [
    "## Preprocessing ends here"
   ]
  },
  {
   "cell_type": "code",
   "execution_count": null,
   "metadata": {},
   "outputs": [],
   "source": [
    "CNN building starts here\n",
    "\n",
    "Recommendation is to use GPU system for larger Dataset\n",
    "For GPU you need to use GPU version of tensorflow and keras."
   ]
  },
  {
   "cell_type": "code",
   "execution_count": 46,
   "metadata": {},
   "outputs": [],
   "source": [
    "from keras.models import Sequential\n",
    "from keras.layers import Conv2D,MaxPooling2D\n",
    "from keras.layers import Activation, Dense, Flatten, Dropout\n",
    "\n",
    "\n",
    "model = Sequential()\n",
    "\n",
    "#Addition of Convolution layer\n",
    "model.add(Conv2D(filters = 3, kernel_size = 2,activation= 'relu',input_shape=(100,100,3)))\n",
    "model.add(MaxPooling2D(pool_size=2))"
   ]
  },
